import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find the "Add to Cart" button for the first product
    const firstAddToCartButton = page.locator('.add-to-cart').first();
    await firstAddToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Click the button to add the product to the cart
    await firstAddToCartButton.click();

    // Wait for the success notification to appear
    await page.waitForSelector('.notification.success', { state: 'visible', timeout: 5000 });

    // Take a screenshot after adding the item to the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_added.png'));

    // Extract the cart text to verify the update
    const cartElement = page.locator('.cart');
    const cartText = await cartElement.textContent();

    return {
      success: true,
      action: "Added the first product to the cart.",
      extractedData: {
        cartText: cartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const screenshots = [];
    try {
        const errorPath = path.join(screenshotsDir, 'error.png');
        await page.screenshot({ path: errorPath });
        screenshots.push(errorPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
